                        <div class="post">
                            <div class="post-header-image">
                                <a href="javascript:void(0);"><img src="http://music.libraryideas.com/freegalmusic/prod/EN/news_image/153.gif" style="width:417px;height:196px;" alt=""></a>
                            </div>
                            <div class="post-title">
                                <a href="javascript:void(0);"></a>
                            </div>
                            <div class="post-date">
                                US/AU/CA/NZ/IT/GB/IE : January 31, 2014                            </div>
                            <div class="post-excerpt">
                                <p class="p1"><span class="s1"><strong>Debut Single from Forthcoming Album Bows At Radio Next Week</strong></span></p>
<p class="p1">&nbsp;</p>
<p class="p1">NASHVILLE, TN – Eight months since the release of her last single, Miranda Lambert is excited to introduce, “Automatic,” the first song from her forthcoming album. Written by Miranda, Nicolle Galyon and Natalie Hemby, the autobiographical song reflects on the days of pay phones, learning to drive a stick shift, driving to Dallas to buy an Easter dress, recording the country countdown on her cassette recorder and more.</p>
<p class="p1">&nbsp;</p>
<p class="p1">“‘Automatic’ is a song about the good life,” said Miranda of the single that is available to radio on Wednesday, February 5. “It’s about slowing down, taking a breath and remembering what it’s like to live life a little more simply. It’s not about going back, but reminiscing about what it was like to hang laundry on the line and wait for it to dry and my dad teaching me how to drive my ’55 Chevy that I still have but don’t drive nearly enough,” she said. “The song brings back good memories and it reminds me to take a deep breath and to remember that getting there is half the fun.”</p>
<p class="p1">&nbsp;</p>
<p class="p1">“Automatic” is the debut single from Miranda’s fifth album, which will be released later this year. “It’s always exciting and little bit nerve-wracking to release a new album,” said Miranda. “We’ve been writing and recording since last summer and I’m ready for the fans to hear my new music.”</p>                            </div>
                        </div>
                    </li>

                                        <li>
                        <div class="post">
                            <div class="post-header-image">
                                <a href="javascript:void(0);"><img src="http://music.libraryideas.com/freegalmusic/prod/EN/news_image/152.gif" style="width:417px;height:196px;" alt=""></a>
                            </div>
                            <div class="post-title">
                                <a href="javascript:void(0);"></a>
                            </div>
                            <div class="post-date">
                                US/AU/CA/NZ/IT/GB/IE : January 15, 2014                            </div>
                            <div class="post-excerpt">
                                <p class="p1"><strong>THE SONG WAS WRITTEN FOR PALOMA BY PHARRELL WILLIAMS, WHO ALSO APPEARS ON THE TRACK AND PRODUCED IT</strong></p>
<p class="p1">&nbsp;</p>
<p class="p1"><strong>PALOMA’S THIRD ALBUM <em>A PERFECT CONTRADICTION</em> COMING&nbsp;</strong><strong>LATER THIS YEAR</strong></p>
<p class="p1">&nbsp;</p>
<p class="p1">(<em>January 13</em><span class="s1"><em><sup>th</sup></em></span><em>, 2013 — New York, NY</em>) - The amazing PALOMA FAITH goes back to her soul roots on brand new single “Can’t Rely On You.”&nbsp; The video directed by Paul Gore (John Legend, Amy Winehouse, Snow Patrol) premiered today on VEVO: <a href="http://smarturl.it/CROYyt"><span class="s2">http://smarturl.it/CROYyt</span></a>.</p>
<p class="p1">&nbsp;</p>
<p class="p1">The single was written for Paloma by Pharrell Williams who also produced the track and appears on it as backing vocalist and singer of the impassioned line “I don’t know what this world is coming to”.</p>
<p class="p1">&nbsp;</p>
<p class="p1">The pair met when Paloma attended the Met Ball at New York’s Metropolitan Museum and Pharrell approached her by singing her song ‘New York’ to her. He then took her ‘phone, put his number in and said ‘I’m ready to work’. She texted him whilst still at the ball to check if he was serious, he texted back to confirm that he was, and the pair recorded the track in Miami.</p>
<p class="p1">&nbsp;</p>
<p class="p1">The song is the first to appear from Paloma’s forthcoming album <em>A Perfect Contradiction</em> which, like the single, shows a distinct return to her early soul-girl roots. Influences as diverse as classic Stax, Phil Spector, 1960’s girl groups, ‘70’s disco and early 1980’s soul come together on an album that is the most upbeat Paloma has ever made.</p>
<p class="p1">&nbsp;</p>
<p class="p1">Watch the amazing new video here:<span class="s3"> <span class="s2"><a href="http://smarturl.it/CROYyt">http://smarturl.it/CROYyt</a></span></span></p>
<p class="p1">&nbsp;</p>
<p class="p1">More details on “Can’t Rely On you” and <em>A Perfect Contradiction </em>to follow.</p>
<p class="p1">&nbsp;</p>
<p class="p1"><a href="http://www.palomafaith.com/">www.palomafaith.com</a></p>
