                                        <li>
                        <div class="post">
                            <div class="post-header-image">
                                <a href="javascript:void(0);"><img src="http://music.libraryideas.com/freegalmusic/prod/EN/news_image/151.gif" style="width:417px;height:196px;" alt=""></a>
                            </div>
                            <div class="post-title">
                                <a href="javascript:void(0);"></a>
                            </div>
                            <div class="post-date">
                                US/AU/CA/NZ : January 15, 2014                            </div>
                            <div class="post-excerpt">
                                <p class="p1">Nashville, TN – Arista Nashville recording artists and NBC&nbsp;<em>The Voice </em>Season 4 finalists The Swon Brothers debuted their new song, “Later On,” to a rousing response during a return performance to the show in December, and “Later On” has now been officially announced as the&nbsp;debut&nbsp;single from the duo’s upcoming album.&nbsp; Penned by Ryan Hurd, Joey Hyde, and Justin Wilson, “Later On” shipped to country radio today, with an official airplay impact date in March.</p>
<p class="p1">&nbsp;</p>
<p class="p1">Released&nbsp;for sale&nbsp;digitally just prior to the duo’s performance on&nbsp;<em>The Voice</em>, “Later On” shot to #1 on iTunes’ Country Top Songs chart within 24 hours, immediately resonating with fans, just as it had with the Swons themselves.</p>
<p class="p1">&nbsp;</p>
<p class="p1">“We are beyond blessed and excited to be releasing our very first single on Arista Nashville! We believe that with the love and support from our fans this song has big potential.” says Zach Swon. &nbsp;</p>
<p class="p1">&nbsp;</p>
<p class="p1">“We’ve waited and prayed for this moment our whole lives &nbsp;and its finally here! We are more than ready to meet all the folks at country radio and want to say thank you in advance for welcoming your two new brothers to the family!,” says Colton Swon.</p>
<p class="p1">&nbsp;</p>
<p class="p1">The Swon Brothers are currently at work on their Arista Nashville debut album, helmed by multi-million-selling producer Mark Bright (Carrie Underwood, Sara Evans).&nbsp; Featuring “Later On,” the album is set for release later this year.</p>
<p class="p1">&nbsp;</p>
<p class="p1">Fans who missed the duo’s December performance of “Later On” on&nbsp;<em>The Voice </em>can see it online here:&nbsp;<a href="http://bit.ly/1cp1DKM"><span class="s1">http://bit.ly/1cp1DKM</span></a>.</p>
<p class="p1">&nbsp;</p>
<p class="p1"><strong>About The Swon Brothers</strong></p>
<p class="p1">&nbsp;</p>
<p class="p1">The Swon Brothers (Zach and Colton) first hit the national radar charming fans with their incredible sibling harmonies and fun-loving personalities as finalists on Team Blake in Season 4 of NBC’s&nbsp;<em>The Voice</em>.&nbsp; Newly signed to the Arista Nashville record label, the brothers returned to&nbsp;<em>The Voice</em>&nbsp;in December of 2013 to perform “Later On,” the first taste of the Muskogee, OK, natives’ upcoming album, helmed by producer Mark Bright (Carrie Underwood, Sara Evans).&nbsp; The journey marks the beginning of an exciting new chapter in the history of the Swons, who had the ambition to take their first swing at a record deal when they were only 9 and 11 years old, asking their parents to stop in Nashville so they could audition at record labels on their way to a family vacation in Florida.&nbsp; Recently honored with the Rising Star award by the Oklahoma Music Hall of Fame, The Swon Brothers are currently writing and securing songs for their major-label debut album, coming later this year.&nbsp; Keep up with The Swon Brothers online at www<a href="http://www.swonbrothers.com/"><span class="s1">.swonbrothers.com</span></a>, on Facebook at<a href="http://www.facebook.com/theswonbrothers"><span class="s1">www.Facebook.com/theswonbrothers</span></a>, and on Twitter&nbsp;<a href="https://twitter.com/TheSwonBrothers"><span class="s1">@TheSwonBrothers</span></a>.</p>                            </div>
                        </div>
                    </li>

                                        <li>
                        <div class="post">
                            <div class="post-header-image">
                                <a href="javascript:void(0);"><img src="http://music.libraryideas.com/freegalmusic/prod/EN/news_image/150.gif" style="width:417px;height:196px;" alt="PHARRELL EARNS SEVEN GRAMMY NOMINATIONS"></a>
                            </div>
                            <div class="post-title">
                                <a href="javascript:void(0);">PHARRELL EARNS SEVEN GRAMMY NOMINATIONS</a>
                            </div>
                            <div class="post-date">
                                US/AU/CA/NZ : December 20, 2013                            </div>
                            <div class="post-excerpt">
                                <p class="p1"><strong>GRAMMY</strong><span class="s1">®</span><strong> AWARD-WINNING SUPERSTAR&nbsp;</strong><strong>PHARRELL WILLIAMS SIGNS WITH COLUMBIA RECORDS</strong></p>
<p class="p1">&nbsp;</p>
<p class="p1"><strong>NEW SINGLE “HAPPY” AVAILABLE NOW</strong></p>
<p class="p1">&nbsp;</p>
<p class="p1"><strong>(Columbia Records; <em>New York, NY</em> – December 17, 2013)</strong>—Columbia Records is thrilled to announce a new partnership with GRAMMY<span class="s1">®</span> Award-winning singer/songwriter/producer Pharrell Williams. The internationally renowned artist’s new single “Happy,” featured on <strong>Despicable Me 2 (Original Motion Picture Soundtrack)</strong>, will also be featured on Williams’ forthcoming Columbia Records full-length debut, set to be released in 2014.</p>
<p class="p1">&nbsp;</p>
<p class="p1">Just last month, Williams released the world’s first 24 hour music video for “Happy,” which is presented as an interactive clock, featuring a diverse cast of characters dancing along to the song. The one-of-a-kind clip can be seen at <a href="http://24hoursofhappy.com/"><span class="s2">http://24hoursofhappy.com</span></a>, and the official version at <a href="http://bit.ly/1dl4DhB"><span class="s2">http://bit.ly/1dl4DhB</span></a>.</p>
<p class="p1">&nbsp;</p>
<p class="p1">News of the signing adds to an already incredible year for Williams. Having co-written and been featured on two of 2013’s best-selling tracks—Robin Thicke’s “Blurred Lines” and Daft Punk’s “Get Lucky”— Williams has also received seven GRAMMY® nominations: Producer of the Year (Non-Classical), two nominations for Record of the Year (“Get Lucky” by Daft Punk ft. Pharrell Williams and&nbsp;“Blurred Lines” by Robin Thicke ft. T.I. and Pharrell Williams), two nominations for Best Pop Duo/Performance (“Get Lucky” by Daft Punk ft. Pharrell Williams and “Blurred Lines” by Robin Thicke ft. T.I. and Pharrell Williams), and two Album of the Year nominations (“Random Access Memories” by Daft Punk and “good kid, m.A.A.d city” by Kendrick Lamar).</p>
<p class="p1">&nbsp;</p>
<p class="p1">“When we excitedly partnered with Pharrell in January of this year, we felt it was his time again,” says Columbia Records Chairman/CEO Rob Stringer. “Since then, ‘Blurred Lines’ and ‘Get Lucky’ have defined pop music in 2013, and now we are preparing to launch Pharrell as a global solo superstar in 2014. ‘Happy’ is just the beginning.”</p>
<p class="p1">&nbsp;</p>
<p class="p1">Redefining cool for a new generation, Pharrell Williams is a creative force, using music, fashion, and design to express his distinctive style. From his beginnings as a teenage prodigy and multi-instrumentalist in Virginia Beach back in the early ’90s, through enough hits to earn him Billboard’s Producer of the Decade in 2010, to his current status as multi-media superstar, Williams has never stopped creating. Starting his producing career as one half of The Neptunes with Chad Hugo, Williams has helped create such classics as Daft Punk’s “Get Lucky,” Robin Thicke’s “Blurred Lines,” Nelly’s “Hot in Herre,” Jay-Z’s “I Just Wanna Love U (Give it 2 Me),” Britney Spears’s “I’m A Slave 4 U,” and Justin Timberlake’s “Like I Love You.”</p>
<p class="p1">&nbsp;</p>
<p class="p1">With over 100 million copies of his productions sold, his music sounds like something no one else has thought of just yet. He’s also created a new way of looking at established stars like Snoop Dogg, Madonna, and even the Rolling Stones. Over four albums, Williams and Hugo along with Shae Haley created an unpredictable hybrid as part of the alt-rock/hip-hop group N.E.R.D. His prolific body of work also ranges from designing a sculpture with Tokyo-born artist Takashi Murakami to accessories and jewelry for luxury goods brands Louis Vuitton and Moncler. Now, with his latest venture i am OTHER — a multi-media creative collective that serves as an umbrella for all his endeavors, including Billionaire Boys Club &amp; ICECREAM apparel, textile company Bionic Yarn and dedicated YouTube channel — Williams’ vision continues to push pop culture forward.</p>                            </div>
                        </div>
                    </li>

                                        <li>
                        <div class="post">
                            <div class="post-header-image">
                                <a href="javascript:void(0);"><img src="http://music.libraryideas.com/freegalmusic/prod/EN/news_image/149.gif" style="width:417px;height:196px;" alt=""></a>
                            </div>
                            <div class="post-title">
                                <a href="javascript:void(0);"></a>
                            </div>
                            <div class="post-date">
                                US/AU/CA/NZ/IT/GB/IE : December 17, 2013                            </div>
                            <div class="post-excerpt">
                                <p class="p1"><strong>SANTANA JOINED BY MUSICAL SUPERSTARS CHOCQUIBTOWN, LILA DOWNS, GLORIA ESTEFAN, JUANES, MIGUEL,&nbsp;</strong><strong>FHER OLVERA OF MANÁ, NIÑA PASTORI, SAMUEL ROSA OF SKANK, ROMEO SANTOS, SOLEDAD AND DIEGO TORRES&nbsp;</strong><strong>SATURDAY NIGHT</strong> <strong>IN GUADALAJARA, MEXICO</strong> <strong>AT THIS ONCE-IN-A-LIFETIME CONCERT EVENT&nbsp;</strong><strong><em>“CORAZÓN, LIVE FROM MEXICO: LIVE IT TO BELIEVE IT”&nbsp;</em></strong><strong><em>IN CONJUNCTION WITH THE MEXICO TOURISM BOARD</em></strong></p>
<p class="p1">&nbsp;</p>
<p class="p1"><strong><em>LIVE CONCERT TO PREMIERE ON HBO LATINO AND HBO LATIN AMERICA SPRING 2014</em></strong></p>
<p class="p2">&nbsp;</p>
<p class="p2"><strong>(New York - Monday, December 16, 2013)</strong> Fresh off of receiving his Kennedy Center Honors Award last week, Carlos Santana took the stage with his band SANTANA this past Saturday, December 14th for a once-in-a-lifetime concert event performing to a sold out house at Arena VFG in Guadalajara, Mexico.&nbsp;SANTANA was joined by some of Latin’s music biggest and brightest stars including ChocQuibTown, Lila Downs, Gloria Estefan, Juanes, Miguel, Fher Olvera of Maná, Niña Pastori, Samuel Rosa of Skank, Romeo Santos, Soledad and Diego Torres, performing songs from his forthcoming studio album <span class="s1"><em>CORAZÓN</em></span>, to be released in spring 2014. The live concert will be released on DVD next year and will premiere on HBO Latino and HBO Latin America in spring 2014.</p>
<p class="p4">&nbsp;</p>
<p class="p4">The concert also featured some of SANTANA’s greatest hits including a rendition of "Corazón Espinado" featuring Fher Olvera of Maná and Cindy Blackman Santana on drums, “Maria, Maria” featuring Miguel, “Oye Como Va,” “Samba Pa Ti” and many others.<span class="s2"> &nbsp;</span>One of the many highlights of the night was the performance of the new single <a href="http://smarturl.it/LaFlaca"><span class="s3">“<strong>La Flaca</strong>”</span></a> where Santana was joined by Juanes on stage and a performance of <a href="http://smarturl.it/Saideira"><span class="s3">“<strong>Saideira</strong>”,</span></a> the Portuguese language single, featuring Samuel Rosa of Skank.<span class="s2"> </span>Both Juanes and Fher Olvera of Maná joined Carlos Santana only last week in Washington, DC when Santana received his Kennedy Center Honors award at a gala celebration also marking his incredible contribution as a national artistic treasure. Other highlights included Gloria Estefan singing “Besos De Lejos,” Romeo Santos on “Margarita,” Miguel on “Indy Jones,”&nbsp;“Iron Lion Zion” with Elan Atias and ChoQuibTown, and “Una Noche A Napoli” with Lila Downs, Niña Pastori, and Soledad.</p>
<p class="p4">&nbsp;</p>
<p class="p4">SANTANA was also joined by mariachi musicians onstage and later by many<span class="s4"> </span>of his special guests for an electrifying finale of the traditional Mexican song “Cielito Lindo.” The concert, which took place 120<span class="s5"> </span>miles from Autlán where Carlos was born, was a true celebration of Carlos’ Mexican and Latin heritage, as well as a homecoming for him. &nbsp;It was also a fitting tribute for the musical icon whom has influenced so many Latin recording artists and has been integral to Latin culture and art over the past decades.</p>
<p class="p4">&nbsp;</p>
<p class="p4">A few days prior to the concert, Carlos filmed interviews for the forthcoming documentary entitled “Live It To Believe It,” on the Riviera Nayarit in Mexico.&nbsp; Carlos was joined in Nayarit by ChocQuibTown, Lila Downs, Juanes, Niña Pastori, Fher Olvera of Maná, Samuel Rosa of Skank, Salvador Santana, Soledad, and Cindy Blackman Santana, who were interviewed in various locations throughout the Nayarit Riviera. &nbsp;The documentary will be included in the DVD release of the show set for release in spring 2014 and will also be featured as part of the HBO special in<span class="s5"> </span>spring 2014.</p>
<p class="p4">&nbsp;</p>
<p class="p4">Comments Rodolfo López Negrete, CEO of the Mexico Tourism Board:</p>
<p class="p4">&nbsp;</p>
<p class="p4">"Santana's concert was amazing. The collaborations with such an array of top artists were powerful. This project will add to the promotion of Mexico as a world-class tourism destination where important events occur. The forthcoming<span class="s5"> </span>DVD and Television special " Corazón, Live from Mexico, Live It to Believe It" offers a great opportunity to touch Mexico's rich culture, diversity and its beautiful destinations.”</p>
<p class="p4">&nbsp;</p>
<p class="p4"><strong>About SANTANA:</strong> For forty years and as many albums later, Santana has sold more than 100 million records and reached more than 100 million fans at concerts worldwide. To date, Santana has&nbsp;won ten GRAMMY<span class="s6"><sup> ®</sup></span> Awards and three Latin GRAMMY<span class="s6"><sup> ®</sup></span> Awards. &nbsp;He won a record-tying nine GRAMMYs for a single project for 1999’s “Supernatural” (including Album of the Year&nbsp;and Record of the Year for “Smooth”). He has also received the&nbsp;Billboard Century Award (1996), was ushered into the Rock and Roll Hall of Fame (1998), and received the Billboard&nbsp;Latin Music Awards’ Lifetime Achievement honor (2009). &nbsp;Among many other honors, Carlos Santana has also been cited by <em>Rolling Stone</em> as #15 on their list of the “100 Greatest&nbsp;Guitarists of All Time.” Celebrating the chart debut of <span class="s1"><em>Guitar Heaven</em></span> (Arista) in 2010, Santana joined the ranks of the Rolling Stones as the only musical act in chart history to score&nbsp;at least one Top 10 album in every decade beginning with the 1960s. He is also currently headlining at a multi-year residency at House of Blues at Mandalay Bay Resort in Las&nbsp;Vegas. On December 8th, Carlos Santana was the recipient of the 2013 Kennedy Center Honors Award.</p>
