<p class="p1"><strong>GUEST APPEARANCES BY CHRIS BROWN, A$AP FERG, PUSHA T, WALE, MEEK MILL AND MORE</strong></p>
<p class="p1">&nbsp;</p>
<p class="p1"><strong>SHAZAM SELECTS KID INK AS ONE OF 2014 NEW ARTISTS TO WATCH&nbsp;</strong><strong>MAKES GLOBAL IMPACT ON RECENT SOLD OUT <em>ROLL UP EUROPEAN TOUR</em></strong></p>
<p class="p1">&nbsp;</p>
<p class="p1">[New York, NY – December 7, 2014] From Los Angeles to London and beyond, 2014 is destined to be the “Year of Kid Ink” as the burgeoning global hip-hop star is set to release his Tha Alumni Music Group/88 Classic/RCA Records debut album <strong><em>My Own Lane</em></strong> on January 7<span class="s2"><sup>th</sup></span>. The album will be available for pre-order at select online retailers on December 17<span class="s2"><sup>th</sup></span>.</p>
<p class="p1">&nbsp;</p>
<p class="p1">Leading the way for <strong>Kid Ink</strong>’s highly anticipated release is the hit single “Show Me” featuring Chris Brown which is currently the #1 Greatest Gainer at Rhythmic radio building towards Top 10 at Rhythmic and Top 20 at Urban radio.</p>
<p class="p1">&nbsp;</p>
<p class="p1">Selected by Shazam as one of “2014 New Artists To Watch,” <strong>Kid Ink</strong> has enlisted notable guest appearances by Chris Brown, A$AP Ferg, Pusha T, Wale, Meek Mill, Elle Varner and more. <strong><em>My Own Lane</em></strong> also showcases an onslaught of head-nodding production by DJ Mustard and others.</p>
<p class="p1">&nbsp;</p>
<p class="p1">This past spring <strong>Kid Ink</strong> released his <em>ALMOST HOME&nbsp;</em>EP to rave reviews by <a href="http://xxlmag.com/"><span class="s3">XXLMag.com</span></a>, <a href="http://thesource.com/"><span class="s3">TheSource.com</span></a>, amongst others, supported Kendrick Lamar on his “good kid, m.A.A.d city World Tour,” and recently wrapped up his successful, sold out 14-date “Roll Up European Tour.”</p>
