                                <a href="javascript:void(0);"><img src="http://music.libraryideas.com/freegalmusic/prod/EN/news_image/147.gif" style="width:417px;height:196px;" alt="MULTI PLATINUM-SELLING ARTIST SARA EVANS TO RELEASE SEVENTH STUDIO ALBUM SLOW ME DOWN ON MARCH 4th"></a>
                            </div>
                            <div class="post-title">
                                <a href="javascript:void(0);">MULTI PLATINUM-SELLING ARTIST SARA EVANS TO RELEASE SEVENTH STUDIO ALBUM SLOW ME DOWN ON MARCH 4th</a>
                            </div>
                            <div class="post-date">
                                US/AU/CA/NZ/IT/GB/IE : December 13, 2013                            </div>
                            <div class="post-excerpt">
                                <p class="p1"><strong><em>Album To Include Collaborations with&nbsp;</em></strong><strong><em>Vince Gill, Isaac Slade of The Fray, and Gavin DeGraw</em></strong></p>
<p class="p1">&nbsp;</p>
<p class="p1">December 9, 2013 – Multi platinum-selling recording artist Sara Evans, one of the most compelling and authentic vocalists in Country music, will release her highly anticipated seventh studio album <em>Slow Me Down, </em>on March 4, 2014. The album comes over two years after the release of <em>Stronger</em>, her second Billboard Country Album Chart #1. Despite five #1 Country songs <em>Slow Me Down</em>’s title track, released earlier this Fall is Sara’s biggest first week Country radio added single ever.&nbsp; The song has been steadily climbing the charts ever since.&nbsp;&nbsp; The video featuring NASCAR great Carl Edwards is now in heavy rotation on both CMT and GAC and can be seen at <a href="http://tinyurl.com/SlowMeDownVideo"><span class="s1">http://tinyurl.com/SlowMeDownVideo</span></a>.</p>
<p class="p3">&nbsp;</p>
<p class="p3"><em>Slow Me Down</em> is co-produced with Mark Bright (Reba McEntire, Rascal Flatts, and Carrie Underwood) who Evans last worked with on her Platinum-selling #1 Country album <em>Real Fine Place</em> (2005). <em>Slow Me Down</em> sees Evans collaborating on three tracks “Better Off” with Country legend Vince Gill, “Can’t Stop Loving You” a duet with Isaac Slade of The Fray and a cover of Gavin DeGraw’s “Not Over You,” which features Gavin singing harmonies. This album is what fans have waited for and newcomers are bound to fall in love with.</p>
<p class="p3">&nbsp;</p>
<p class="p3">“Making <em>Slow Me Down</em> has been a truly amazing experience,” said Evans. “I had the chance to co-write with some of my favorite writers, work with Mark (Bright) and some truly incredible&nbsp;musicians &nbsp;- and now hearing what we created gives me such an incredible sense of pride. &nbsp;Having Isaac (Slade), Gavin (DeGraw), and Vince (Gill) sing with me, was an amazing experience and they took those songs to&nbsp;another&nbsp;level. I honestly have never been more excited to have everyone hear one of my albums. I cannot wait to share it with everyone.”</p>
<p class="p3">&nbsp;</p>
<p class="p3"><em>Slow Me Down </em>is Sara Evans at her finest, with her signature powerful vocals that will serve as a reminder of why she has had a level of success reserved for few. Evans co-wrote three of the albums eleven-tracks and some of Nashville’s finest songwriters are represented on <em>Slow Me Down. </em>A virtual who’s who of songwriters on the album include Dave Berg (Keith Urban, Reba McEntire, Blake Shelton), Shane McAnally (Florida Georgia Line, Kasey Musgraves, Kelly Clarkson), Karyn Rochelle (Trisha Yearwood, LeAnn Rimes, Ronnie Milsap), Sarah Buxton (Keith Urban, The Band Perry, Gary Allan), and Shane Stevens (Lady Antebellum, Kellie Pickler, Montgomery Gentry), amongst many others.</p>
<p class="p3">&nbsp;</p>
<p class="p3">Since emerging in the late 1990s, Sara Evans has had five #1 songs, four others appearing in the Top 10, two #1 Billboard Country Albums, five appearing on Billboard’s Top 200 all-genre chart and four consecutive RIAA certified Gold, Platinum or Multi-Platinum albums. She’s received awards from the Country Music Association, Academy of Country Music, Billboard Music Award and has garnered nominations for Grammy Awards (2), American Country Awards (10) and CMT Music Awards (5). Sara won the hearts of America as the first country artist to compete in ABC’s <em>Dancing with the Stars </em>and was also chosen as one of People Magazine’s “50 Most Beautiful People.”</p>
<p class="p3">&nbsp;</p>
<p class="p3">For more official Sara Evans news and ticket information go to <a href="http://www.saraevans.com/"><span class="s1">www.saraevans.com</span></a>. &nbsp;</p>                            </div>
                        </div>
                    </li>

