                                <a href="javascript:void(0);"><img src="http://music.libraryideas.com/freegalmusic/prod/EN/news_image/146.gif" style="width:417px;height:196px;" alt="LEA MICHELE TO RELEASE HIGHLY ANTICIPATED DEBUT ALBUM LOUDER MARCH 4, 2014"></a>
                            </div>
                            <div class="post-title">
                                <a href="javascript:void(0);">LEA MICHELE TO RELEASE HIGHLY ANTICIPATED DEBUT ALBUM LOUDER MARCH 4, 2014</a>
                            </div>
                            <div class="post-date">
                                US/AU/CA/NZ : December 13, 2013                            </div>
                            <div class="post-excerpt">
                                <p class="p1"><strong>DEBUT SINGLE “<em>CANNONBALL</em>” TO PREMIERE ON&nbsp;</strong><strong><em>THE ELLEN DEGENERES SHOW</em> DECEMBER 12</strong><span class="s1"><strong><sup>th</sup></strong></span></p>
<p class="p1">&nbsp;</p>
<p class="p1"><strong>(New York, NY; Columbia Records; December 10, 2013) –</strong> Lea Michele, star of Fox Television’s popular series,<em> Glee, </em>is set to release her highly anticipated debut album <strong>LOUDER</strong> on March 4, 2014. Marking Michele’s career as a solo artist, the album is underscored by the singer’s beloved pop voice, beautiful ballads, and emotionally-driven lyrics. The album is currently available for pre-order now and includes an instant download of the moving lead single, “<em>Cannonball</em>,” which Michele will unveil this Thursday December 12<span class="s2"><sup>th</sup></span> with a performance on<em> The Ellen DeGeneres Show</em>. Stream “<em>Cannonball</em>” here: <a href="http://smarturl.it/CannonballPseudo"><span class="s3">http://smarturl.it/CannonballPseudo</span></a>.</p>
<p class="p1">&nbsp;</p>
<p class="p1">“<strong>LOUDER</strong> really encompasses my experiences over this past year and my journey as an artist up to this point,” said Lea Michele. “There’s a lot of emotion but it’s also very encouraging and hopeful—it’s about pushing forward and living your life in a way that’s louder, stronger and bolder. I’m so excited to share this new side of me with my fans.”</p>
<p class="p1">&nbsp;</p>
<p class="p1">Recorded over the past year, stand out tracks on<strong> LOUDER</strong> include the Sia penned lead single <em>“Cannonball”,</em> the pop/rock anthem “<em>On My Way</em>,” and “<em>Battlefield</em>,” a heartfelt ballad also in collaboration with Sia. Other album favorites include the edgy-pop song “<em>Burn With You,” </em>and the title track “<em>Louder</em>” which culminates this eclectic album. Standout contributors include Christina Perri, Colin Munroe and Stargate. Lea’s debut album <strong>LOUDER</strong> is available for pre-order now and includes an instant download of her debut single <em>“Cannonball,”</em> visit <a href="http://www.leamichelemusic.com/"><span class="s3">www.LeaMicheleMusic.com</span></a> for more info.</p>
<p class="p1">&nbsp;</p>
<p class="p1">The track list for <strong>LOUDER</strong> is as follows:</p>
<p class="p3">1. Cannonball</p>
<p class="p3">2. On My Way</p>
<p class="p3">3. Burn with You</p>
<p class="p3">4. Battlefield</p>
<p class="p3">5. You're Mine</p>
<p class="p3">6. Thousand Needles</p>
<p class="p3">7. Louder</p>
<p class="p3">8. Cue the Rain</p>
<p class="p3">9. Don't Let Go</p>
<p class="p3">10. Empty Handed</p>
<p class="p3">11. If You Say So</p>
<p class="p3">&nbsp;</p>
<p class="p3">Lea Michele is best known for her performance as “Rachel Berry” on the critically acclaimed, Golden Globe, Grammy, and SAG award-winning Fox television series <em>Glee</em>. She has been nominated for an Emmy, a SAG Award, and multiple Golden Globes. The <em>Glee </em>cast recordings have sold over 10 million singles and garnered over 20 top 40 US Billboard Hot 100 hits. Currently serving as a spokesperson for L’Oreal Paris, Michele will release her first book <em>Brunette Ambition</em> this spring with Crown Archetype and lends her vocal talents as “Dorothy” in Summertime Entertainment’s animated 3D musical <em>Dorothy of Oz</em>, set for release in early 2014.</p>
<p class="p3">&nbsp;</p>
<p class="p3">For more info visit</p>
<p class="p7"><a href="http://www.leamichelemusic.com/">http://www.leamichelemusic.com</a></p>
<p class="p7"><a href="http://www.columbiarecords.com/">http://www.columbiarecords.com</a></p>                            </div>
                        </div>
                    </li>

