                            <div class="post-date">
                                US/AU/CA/NZ/GB/IE : December 06, 2013                            </div>
                            <div class="post-excerpt">
                                <p class="p1"><strong>HIGHLY ANTICIPATED <em>L.O.R.D.</em> EP SET FOR MARCH 4</strong><span class="s1"><strong><sup>TH</sup></strong></span><strong> RELEASE ON&nbsp;</strong><strong>A$AP WORLDWIDE/POLO GROUND MUSIC</strong></p>
<p class="p1">&nbsp;</p>
<p class="p1"><strong>SINGLE CURRENTLY AVAILABLE AT SELECT DIGITAL RETAILERS</strong></p>
<p class="p1">&nbsp;</p>
<p class="p1"><strong>LISTEN TO “TRILLMATIC” </strong><a href="https://soundcloud.com/asapmobofficial/a-ap-mob-trillmatic-feat-a-ap/s-OP6p5"><span class="s2"><strong>HERE</strong></span></a><strong> AND WATCH THE VIDEO </strong><span class="s2"><strong><a href="http://www.vevo.com/watch/USRV81300749">HERE</a></strong></span></p>
<p class="p1">&nbsp;</p>
<p class="p1">[December 5, 2013]&nbsp; A$AP Mob has released “Trillmatic,” the gritty lead single and video featuring A$AP Nast and legendary lyricist Method Man from their highly anticipated EP, <em>L.O.R.D.,</em> set for a March 4, 2014 release on A$AP Worldwide/Polo Grounds Music/RCA Records.</p>
<p class="p2">&nbsp;</p>
<p class="p2">The Jonah Schwartz -directed “Trillmatic” video made its national television broadcast debut on BET’s <span class="s3">106 &amp; Park</span> and can now be viewed on <a href="http://www.vevo.com/watch/USRV81300749"><span class="s2">VEVO.com</span></a>. Produced by Ty Beats, the “Trillmatic” single is currently available at iTunes, <a href="http://amazon.com/"><span class="s2">Amazon.com</span></a> and select digital retailers.</p>
<p class="p2">&nbsp;</p>
<p class="p2">Much like “Trillmatic,” the overall style and feel of <em>L.O.R.D.</em> will be a throwback to 90’s hip-hop with a twist that only A$AP Mob can execute. The EP will feature the entire Mob, inclusive of A$AP Rocky, A$AP Ferg, A$AP Nast, A$AP Twelvy and A$AP Ant.&nbsp; More details from the album will be announced shortly.</p>
<p class="p2">&nbsp;</p>
<p class="p2">A collective of rappers, producers, video directors, fashion designers and models, A$AP Mob released their first mixtape, <em>Lord$ Never Worry</em> in August 2012 and embarked on the sold-out Long Live A$AP Tour the following month.&nbsp;&nbsp; A$AP Mob is currently on A$AP Ferg’s first ever headlining Turnt x Burnt Tour, which hits their hometown on December 6<span class="s1"><sup>th</sup></span> at New York City’s Irving Plaza.</p>
