                            <div class="post-title">
                                <a href="javascript:void(0);">Carrie Underwood Brings the Hills to Life!</a>
                            </div>
                            <div class="post-date">
                                US/AU/CA/NZ/IT/GB/IE : December 04, 2013                            </div>
                            <div class="post-excerpt">
                                <p class="p1"><strong>NBC’s <em>The Sound of Music Live!</em> Airs December 5;&nbsp;</strong><strong>Cast Soundtrack Available Today</strong></p>
<p class="p1">&nbsp;</p>
<p class="p1">Nashville, TN – The hills are indeed alive this week as six-time GRAMMY® winner Carrie Underwood prepares for her much-anticipated performance as Maria in NBC’s three-hour television production, <em>The Sound of Music Live!</em>, based on the original musical.&nbsp;&nbsp;&nbsp;&nbsp; In advance of Thursday’s live broadcast, Sony Masterworks today releases the companion soundtrack, <em>“The Sound of Music” — Music from the NBC Television Event</em>, featuring studio recordings for all of the musical numbers performed by the cast in the live broadcast, including such Rodgers &amp; Hammerstein favorites as “My Favorite Things,” “Do-Re-Mi,” and the classic title track.</p>
<p class="p2">&nbsp;</p>
<p class="p2">Also starring TV and theater star Stephen Moyer and Tony Award winners Audra McDonald, Christian Borle and Laura Benanti, <em>The Sound of Music Live!</em> will air from 8 – 11 PM ET on December 5, on NBC, and will be released on DVD on December 17.</p>
<p class="p2">&nbsp;</p>
<p class="p2">In addition to today’s soundtrack release, fans will have a chance to whet their appetites for the live event when on Thursday morning, NBC’s <em>Today</em> airs Natalie Morales’ exclusive interview with Underwood, together with a look behind the scenes on the set of <em>The Sound of Music Live!</em> with Stephen Moyer.</p>
<p class="p2">&nbsp;</p>
<p class="p2">Also in the spirit of the season and one of the show’s most famous songs, “My Favorite Things,” Carrie and her fans are gathering online to share some of their own favorite things.&nbsp; Continuing through the last Friday of December, fans can post photos or videos on Instagram using the hashtag #FavoriteThingsFridays, and selected posts each week will be featured on <a href="https://www.facebook.com/carrieunderwood"><span class="s1">Facebook.com/CarrieUnderwood</span></a>.&nbsp; For complete details, and to view the submissions – including Carrie’s postings of her own favorite things – visit <a href="http://www.favoritethingsfridays.com/"><span class="s1">www.FavoriteThingsFridays.com</span></a>.</p>
<p class="p2">&nbsp;</p>
<p class="p2">Carrie’s “favorite things” are now in the spotlight on Gilt City (<a href="http://bit.ly/1c7edzM"><span class="s1">http://bit.ly/1c7edzM</span></a>), which highlights experiences inspired by Carrie in 11 major cities, together with a Gilt StyleFile interview, online here: <a href="http://www.gilt.com/blog/women/tastemakers-style-icons/2013/12/03/exclusive-carrie-underwood-talks-sound-of-music-shares-a-few-of-her-favorite-things/"><span class="s1">http://www.gilt.com/blog/women/tastemakers-style-icons/2013/12/03/exclusive-carrie-underwood-talks-sound-of-music-shares-a-few-of-her-favorite-things/</span></a>.</p>
<p class="p2">&nbsp;</p>
<p class="p2">Fans can also look for Underwood on the cover of the December 9 issue of <em>Country Weekly</em> (on stands now), with an exclusive interview and feature about <em>The Sound of Music Live!</em></p>
<p class="p2">&nbsp;</p>
<p class="p2">Since releasing her debut album in 2005, Carrie has sold over 15 million albums and charted 18 #1 singles, nine of which she co-wrote. Her current album, <em>Blown Away</em>, made history by debuting at #1 on&nbsp;<em>Billboard</em>’s Top Country Albums Chart, making Carrie only the second country artist in the 47-year history of the chart to have each of their first four albums debut at #1. &nbsp;The now Platinum-selling <em>Blown Away</em>&nbsp;album also debuted at #1 on the all-genre <em>Billboard</em> 200 chart, making Carrie only the second country artist in history to have three consecutive albums debut at #1.&nbsp; She is a six-time GRAMMY® winner, a two-time Academy of Country Music Entertainer of the Year, a three-time Country Music Association and ACM Female Vocalist winner, and a proud member of the Grand Ole Opry.</p>
<p class="p2">&nbsp;</p>
<p class="p2">Follow Carrie on Twitter <a href="https://twitter.com/carrieunderwood"><span class="s1">@carrieunderwood</span></a>.</p>
